def increasing(seq):

    i = 1
    boolen = True
    while i < len(seq):

        if seq[i - 1] <= seq[i]:
            i += 1
        else:
            boolen = False
            return boolen

    return boolen

def frequency_sequence(seq):

    if not increasing(seq):
        raise AssertionError("given sequence is not increasing")

    seq = list(seq)
    freq = []
    for i in range(1, max(seq) + 2):

        rec = 0
        for element in seq:
            if element < i:
                rec += 1

        freq.append(rec)

    return freq

def lift(seq):

    out = []
