    assert increasing(sequence), 'given sequence is not increasing'
    check = 1
    add = 0
    result = []
    while check != max(sequence) + 1:
        for number in sequence:
            if number < check:
                add += 1
        result.append(add)
        add = 0
        check += 1
    result.append(len(sequence))
    return result


